-- ----------------------------
-- Table structure for list_spawnareas
-- ----------------------------
CREATE TABLE `list_spawnareas` (
  `id` int(11) NOT NULL default '0',
  `map` int(11) NOT NULL default '0',
  `montype` int(11) NOT NULL default '0',
  `min` int(11) NOT NULL default '0',
  `max` int(11) NOT NULL default '0',
  `respawntime` int(11) NOT NULL default '0',
  `points` varchar(255) NOT NULL default '0',
  `agressive` int(11) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

